import React from "react";
import { Route, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Error from "./Error";
import Menu from "./Menu";
import User from "./User";

function App() {
    const Name = () => {
        return <h1>hwlo name</h1>
    }
    return (
        <>
            <Menu />
            <Routes>
                <Route exact path="/" element={<About name='About'/>} />
                <Route exact path="/contact" element={<Contact name='Contact' />} />
                <Route exact path="/Search" element={<Contact name='Contact' />} />
                <Route exact path="/user/:fname/:lname" element={<User />}></Route>
                <Route ecaxt path="/contact/Name" element={<Name />} />
                <Route path="*" element={<Error />} />
            </Routes>
        </>
    )
}

export default App;
